column8:
津田レーシングとビルシュタインとのコラボレーションによってついに完成したノーマル車高用のストリートダンパー。<br>
 ノーマルスプリングとのマッチングを最大限に考えた特性で、JB23特有のピッチングやロールを完全に解消!
<br>
さらに乗り心地まで改善した最強のダンパーセットです。<br>
<br>
